import React from 'react';
import logo from './logo.png';
export class Home extends React.Component { // Tell webpack this JS file uses this image

  

     constructor(props) {
       super(props);
     }


    render(){
        console.log(logo);
        return (
            <div className="Home">
                <div className="Home">
                    <img src={logo} alt="Logo" />
                </div>
            </div>
        );
    }
}

export default Home;
